import {
  View,
  Text,
  ImageBackground,
  Image,
  StyleSheet,
  TextInput,
  TouchableWithoutFeedback,
  Keyboard,
} from "react-native";
import { TextButton } from "../../components";
import { COLORS, FONTS, SIZES } from "../../constants";
import { useState } from "react";
import { SvgUri } from "react-native-svg";
import logos from "../../constants/logo";

import { SignUpReq } from "../../requests/OnboardReq";

const SignUp = ({ navigation }) => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [username, setUsername] = useState("");
  const [role, setRole] = useState("");

  console.log("handle: " + username);
  console.log("email: " + email);
  console.log("password:" + password);
  console.log("role: " + role);
  return (
    <TouchableWithoutFeedback onPress={Keyboard.dismiss} accessible={false}>
      <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        <SvgUri
          style={{ marginTop: "-60%" }}
          width="100%"
          height="100%"
          uri={logos.logo_light_transparent}
        />

        <View
          style={{ top: -300, marginLeft: "-20%", width: SIZES.width * 0.6 }}
        >
          <Text style={{ fontWeight: "bold", ...FONTS.h2 }}>Sign Up!</Text>
          <Text style={{ ...FONTS.body4, color: COLORS.lightGray1_new }}>
            Please login or sign up to continue{" "}
          </Text>

          <View style={{ marginTop: 60 }}>
            <View>
              <Text style={{ fontWeight: "bold", ...FONTS.h3 }}>Username</Text>
              <TextInput
                style={{ ...FONTS.h3 }}
                onChangeText={setUsername}
                autoCapitalize="none"
              />
              <View
                style={{
                  height: 1,
                  width: "135%",
                  backgroundColor: COLORS.lightGray1_new,
                }}
              ></View>
            </View>

            <View style={{ marginTop: 20 }}>
              <Text style={{ fontWeight: "bold", ...FONTS.h3 }}>Email</Text>
              <TextInput
                style={{ ...FONTS.h3 }}
                onChangeText={setEmail}
                autoCapitalize="none"
              />
              <View
                style={{
                  height: 1,
                  width: "135%",
                  backgroundColor: COLORS.lightGray1_new,
                }}
              ></View>
            </View>

            <View style={{ marginTop: 20 }}>
              <Text style={{ fontWeight: "bold", ...FONTS.h3 }}>Password</Text>
              <TextInput
                style={{ ...FONTS.h3 }}
                onChangeText={setPassword}
                secureTextEntry={true}
                autoCapitalize="none"
              />
              <View
                style={{
                  height: 1,
                  width: "135%",
                  backgroundColor: COLORS.lightGray1_new,
                }}
              ></View>
            </View>

            <View style={{ marginTop: 20 }}>
              <Text style={{ fontWeight: "bold", ...FONTS.h3 }}>User Role</Text>
              <TextInput
                style={{ ...FONTS.h3 }}
                onChangeText={setRole}
                autoCapitalize="none"
              />
              <View
                style={{
                  height: 1,
                  width: "135%",
                  backgroundColor: COLORS.lightGray1_new,
                }}
              ></View>
            </View>
          </View>
        </View>

        <TextButton
          label={"Sign Up"}
          labelStyle={styles.label}
          buttonContainerStyle={styles.buttonContainer}
          onPress={() => SignUpReq(email, password, role, username)}
        />
      </View>
    </TouchableWithoutFeedback>
  );
};

export default SignUp;

const styles = StyleSheet.create({
  buttonContainer: {
    width: 353,
    height: 51,
    borderRadius: 20,
    alignSelf: "center",
    backgroundColor: "black",
    top: -150,
  },
  label: {
    alignSelf: "center",
    color: "white",
  },
  overlay: {
    backgroundColor: "rgba(255,0,0,0.5)",
  },
});

